import React, { Component } from 'react';
import "./App.css"
import Navbar from './components/Navbar/Navbar';
import Home from './components/pages/Landing Page/Home'
import SignInMain from './components/pages/Sign In Page/SignInMain';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
    return(
        <Router>
            <Navbar>
            <Link to='/'> Home </Link>
            <Link to='/signIn'> Home </Link>
            <Link to='/settings'> Home </Link>
                <Routes>
                    <Route path="/" element={<Home/>}/>
                    <Route path="/signIn" element={<SignInMain/>}/>
                    <Route path="/" element={<Home/>}/>
                </Routes>
            </Navbar>
        </Router>
    )
};

export default App;
